export const ContactPicker = ({contacts, setContactName}) => {
  setContactName(value)
  return (
    <select id="contact" onChange={(e) => setContactName(e.target.value)}>
      {contacts.map(contact => <option>{contact.name}</option>)}
    </select>
  );
};
